import {
  Button,
  Card,
  Space,
  Divider,
} from '@fruits-chain/react-native-xiaoshu'
import { DoubleArrowClockwiseOutline } from '@fruits-chain/icons-react-native'
import { Animated, ColorValue } from 'react-native'

const CustomLoading = ({
  size,
  color,
}: {
  size: number
  color: ColorValue
}) => {
  const spin = useRef(new Animated.Value(0))

  useEffect(() => {
    let stop = false
    const action = Animated.timing(spin.current, {
      toValue: 1,
      duration: 600,
      useNativeDriver: true,
    })
    const loop = () => {
      if (stop) {
        return
      }

      action.start(({ finished }) => {
        if (finished) {
          action.reset()
          loop()
        }
      })
    }

    loop()

    return () => {
      stop = true
      action.stop()
    }
  }, [])

  return (
    <Animated.View
      style={{
        width: size,
        height: size,
        alignContent: 'center',
        justifyContent: 'center',
        transform: [
          {
            rotateZ: spin.current.interpolate({
              inputRange: [0, 1],
              outputRange: ['0deg', '360deg'],
            }),
          },
        ],
      }}>
      <DoubleArrowClockwiseOutline size={size} color={color} />
    </Animated.View>
  )
}

